> And because the value of the call is 0, no account is created and basically nothing is done so we should decide whether we want to include those in the trace.

We do ping the opcode-tracer : https://github.com/ethereum/go-ethereum/blob/master/core/vm/evm.go#L184 
So yeah, do we want to ping the scope-tracer aswell? Seems like the correct thing to do 

EDIT: My bad, that code doesn't ping the opcode tracer, it just ping the start/end, but that's where we'd have to add a ping. 
```diff
--- a/core/vm/evm.go
+++ b/core/vm/evm.go
@@ -182,9 +182,14 @@ func (evm *EVM) Call(caller ContractRef, addr common.Address, input []byte, gas
        if !evm.StateDB.Exist(addr) {
                if !isPrecompile && evm.chainRules.IsEIP158 && value.Sign() == 0 {
                        // Calling a non existing account, don't do anything, but ping the tracer
-                       if evm.Config.Debug && evm.depth == 0 {
-                               evm.Config.Tracer.CaptureStart(evm, caller.Address(), addr, false, input, gas, value)
-                               evm.Config.Tracer.CaptureEnd(ret, 0, 0, nil)
+                       if evm.Config.Debug {
+                               if evm.depth == 0 {
+                                       evm.Config.Tracer.CaptureStart(evm, caller.Address(), addr, false, input, gas, value)
+                                       evm.Config.Tracer.CaptureEnd(ret, 0, 0, nil)
+                               } else {
+                                       evm.Config.Tracer.CaptureEnter(CALL, caller.Address(), addr, input, gas, value)
+                                       evm.Config.Tracer.CaptureExit(nil, 0, nil)
+                               }
                        }
                        return nil, gas, nil
                }

